const verifyrsa = require("../verifyrsa");
const web3helpers = require('../../web3helpers');

const m = web3helpers.readfile();
const s0 = "0x"+"";
const s1 = "0x"+"";
const s2 = "0x"+"";
const s3 = "0x"+"";
const s4 = "0x"+"";

switch (parseInt(process.argv[2])) {
    case 1:
        one();
        break;
    case 2:
        two();
        break;
    case 3:
        three();
        break;
    case 4:
        four();
        break;
    case 5:
        five();
        break;
    default:
        console.log("Destination unknown");
}

function one() {
    const S = s0;
    verifyrsa.measure(m, S)
}

function two() {
    const S = s0+s1;
    verifyrsa.measure(m+m, S)
}

function three() {
    const S = s0+s1+s2;
    verifyrsa.measure(m+m+m, S)
}

function four() {
    const S = s0+s1+s2+s3;
    verifyrsa.measure(m+m+m+m, S)
}

function five() {
    const S = s0+s1+s2+s3+s4;
    verifyrsa.measure(m+m+m+m+m, S)
}
